tration of password habits for securing high risk sites and applications.\\nHandling PII\\nAwareness of what constitutes PII and the proper safeguards for protecting it.\\nSocial Media\\nGeneral understanding of the risks associated with social media relating to protecting\\ncompany information.\\nWorking Remotely\\nComprehension of best habits for working remotely.\\n0%\\n0%\\n0%\\n0%\\n0%\\n0%\\n\\n3.1Baseline Assessment Score Details\\nExisting Data Automation (Please Dont Touch - Test)September 03, 2025By: April Partner Automation\\nWeve provided a detailed analysis of your organizations baseline cybersecurity assessment scores broken down\\nby employee. For more information on any additional results, please work with your administrator.\\nOverall\\nScore\\nName/Email/Job\\nGeneral\\nCybersecurity\\nKnowledge\\nPhishing\\nAwareness\\nPassword\\nHygiene\\nHandling\\nPII\\nSocial\\nMedia\\nWorking\\nRemotely\\nData\\nBreaches\\nTime Taken\\n(minutes)\\nRisk\\nNo users have completed the Baseline Cybersecurity Assessment\\nMedium Risk - 0%\\nTotal Employees: 0\\nLow Risk - 0%\\nTotal Employees: 0\\nHigh Risk - 0%\\nTotal Employees: 0&#x27; to include &#x27;Baseline Employee \\nCybersecurity Assessment Report\\n&#x27;\n    at Context.eval (webpack://pii-protect/./cypress/page-objects/pii-portal/my-company/employee_assessments.ts:664:51)\n    at getRet (https://portal.breachsecurenow.com/__cypress/runner/cypress_runner.js:120768:20)\n    at tryCatcher (https://portal.breachsecurenow.com/__cypress/runner/cypress_runner.js:1777:23)\n    at Promise.attempt.Promise.try (https://portal.breachsecurenow.com/__cypress/runner/cypress_runner.js:4285:29)\n    at Context.thenFn (https://portal.breachsecurenow.com/__cypress/runner/cypress_runner.js:120779:66)\n    at Context.then (https://portal.breachsecurenow.com/__cypress/runner/cypress_runner.js:121030:21)&quot;,&quot;diff&quot;:null},&quot;uuid&quot;:&quot;4dbaa990-ce09-4e15-93a3-c27415bfcd5d&quot;,&quot;parentUUID&quot;:&qu
